import React from 'react'

export default function ContactCard() {
  return (
<div className='item'>
    <div className='content'>
        <div className='header'>
            {contacts.name}
        </div>
        <div>
            {contacts.email}
        </div>
        <i className='trash alternate outline icon' style={{color:'red',marginTop:"7px"}}></i>

    </div>

</div>

  )
}
